import React, { Component } from 'react';
import Base from './base';
import $ from 'jquery'

const Friends = () => {
  $.ajax({
    url: "https://app165.acapp.acwing.com.cn/myspace/userlist/",
    type: "GET",
    success(resp) {
      console.log(resp)
    }
  })

  return ( 
    <Base>
      <div className="card">
        <div className="card-body">
          <div className="col-3">
            <img />
          </div>
          <div className="col-9"></div>
        </div>
      </div>
    </Base>
  );
}

export default Friends
